import { useDispatch } from "react-redux";

export default function TemperamentFilter() {
  let dispatch = useDispatch();

  const handleSelect = (e) => {
    e.preventDefault();
    dispatch();
  };

  return (
    <div>
      <select onChange={(e) => handleSelect(e)}></select>
    </div>
  );
}
